const Swal=window["Swal"];function showMessage(e,s){Swal.fire({text:e,icon:s,timer:1500,timerProgressBar:!0})}if(sessionStorage.getItem("live_klant")){console.log("ingelogde klant gevonden");const c=JSON.parse(sessionStorage.getItem("live_klant"));c.admin?showMessage(`Welkom ${c.naam}!`,"success"):showMessage("Alleen toegankelijk voor admins!","error")}else showMessage("Je moet ingelogd zijn als admin!","error");